import React, { useState } from 'react';
import './App.css';
import Game from './components/Game';

function App() {
  const [size, setSize] = useState(0);

  return (
    <div className="App">
      <input onChange={(e)=>setSize(e.current.value)} />
      <Game size={size}/>
      <Game>
      <Board>
        <Cell/>
      </Board>
      <Dice/>
      <Player/>
    </Game>
    </div>
  );
}

export default App;
